import React, { useState } from "react";
import { auth } from "../Firebase";
import { createUserWithEmailAndPassword, updateProfile } from "firebase/auth";
import houseImg from "../assets/loginhome.avif"; 
import { useNavigate, Link } from "react-router-dom";

const SignupPage = () => {
  const navigate = useNavigate();
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");

  const handleSignup = async (e) => {
    e.preventDefault();
    if (password !== confirmPassword) {
      alert("Passwords do not match!");
      return;
    }
    try {
      const userCredential = await createUserWithEmailAndPassword(auth, email, password);
      await updateProfile(userCredential.user, { displayName: name });

      // Save safe info in localStorage
      const userData = { uid: userCredential.user.uid, name, email };
      localStorage.setItem("user", JSON.stringify(userData));

      alert("Account created successfully!");
      navigate("/Home");
    } catch (error) {
      alert(error.message);
    }
  };

  return (
    <div style={{ display: "flex", flexDirection: "column", minHeight: "100vh" }}>
      {/* Navbar */}
      <div style={styles.navbar}>
        <button onClick={() => navigate("/Home")} style={styles.navButtonWhite}>Back to Home</button>
        <div style={styles.navTitle}>MyApp Title</div>
        <button onClick={() => navigate("/About us")} style={styles.navButtonBlue}>About Us</button>
      </div>

      {/* Main Content */}
      <div style={styles.main}>
        {/* Left Form */}
        <div style={styles.left}>
          <h2>Create Account</h2>
          <form onSubmit={handleSignup} style={styles.form}>
            <input type="text" placeholder="Enter your name" value={name} onChange={(e) => setName(e.target.value)} required />
            <input type="email" placeholder="Enter your email" value={email} onChange={(e) => setEmail(e.target.value)} required />
            <input type="password" placeholder="Enter your password" value={password} onChange={(e) => setPassword(e.target.value)} required />
            <input type="password" placeholder="Confirm your password" value={confirmPassword} onChange={(e) => setConfirmPassword(e.target.value)} required />
            <button type="submit" style={styles.submitButton}>Create Account</button>
          </form>
          <div style={{ marginTop: "20px", textAlign: "center" }}>
            Already have an account? <Link to="/Login" style={{ color: "#007bff", cursor: "pointer" }}>Login</Link>
          </div>
        </div>

        {/* Right Image (hidden on mobile) */}
        <div style={styles.right}>
          <img src={houseImg} alt="House" style={styles.image} />
        </div>
      </div>
    </div>
  );
};

// Styles
const styles = {
  navbar: { display: "flex", justifyContent: "space-between", alignItems: "center", padding: "10px 30px", borderBottom: "1px solid #ddd" },
  navButtonWhite: { background: "white", color: "#007bff", border: "1px solid #007bff", padding: "6px 12px", borderRadius: "6px", cursor: "pointer" },
  navButtonBlue: { background: "#007bff", color: "white", padding: "6px 12px", borderRadius: "6px", border: "none", cursor: "pointer" },
  navTitle: { textAlign: "center", fontSize: "20px", fontWeight: "bold" },
  main: { display: "flex", flex: 1, flexDirection: "row" },
  left: { flex: 0.4, padding: "40px" },
  right: { flex: 0.6 },
  image: { width: "100%", height: "100%", objectFit: "cover" },
  form: { display: "flex", flexDirection: "column", gap: "15px" },
  submitButton: { background: "#007bff", color: "white", padding: "10px", border: "none", borderRadius: "6px", cursor: "pointer" },
};

// Responsive: hide image on mobile
const mediaQuery = window.matchMedia("(max-width: 768px)");
if (mediaQuery.matches) {
  styles.main.flexDirection = "column";
  styles.left.padding = "20px";
  styles.right.display = "none"; // hide image
}

export default SignupPage;
